
#include <bits/stdc++.h>
using namespace std;

string minWindow(string s, string t) {
    //cout << "length need: " << 'z' - 'A' << endl;
    string res;
    //queue<int> pinBegin;
    int count = 0;
    int tarCout = 0;
    int sta = 0, end;
    int min_len = INT_MAX;
    vector<int> fres(58,0);
    vector<int> fret(58,0);
    if (s.size() < t.size()) return res;

    for (auto i:t){
        if (fret[i-'A'] ==0) tarCout++;
        
        fret[i-'A']++;
    }
    cout << "target count: " << tarCout << endl;
    for (int i = 0; i < s.size(); i++){
        cout << "\n\ni: " << i << endl;
        cout << "count: " << count << " start:" << sta << " end:" << end << endl;
        
        fres[s[i]-'A']++;
        
        //if (fret[s[i]-'A'] >0){
        //    pinBegin.push(i);
        //}

        if (fres[s[i]-'A'] == fret[s[i]-'A']){
            count++;
        }
        

        while (count == tarCout){
            //sta = pinBegin.front();
            end = i;
            cout << "start: " << sta << " end: " << end <<endl;
            if (end-sta+1 < min_len){
                
                res = s.substr(sta,end-sta+1);
                min_len = end-sta+1;
            }
            //int stai = pinBegin.front();
            fres[s[sta]-'A']--;
            if (fret[s[sta]-'A'] > 0 && fres[s[sta]-'A'] < fret[s[sta]-'A'] ){
                count--;
            }
            sta++;
            
            //sta = pinBegin.front();
        }
        
        
    }
    return res;

}

int main(int arg, char* argv[]){
    string s = "";
    string t = "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ";
    string res = minWindow(s,t);
    cout << "Result: \n";
    cout << res << endl;
    return 1;
}

